from botlogic.models.server import Serverdef setup(bot):    @bot.event    async def on_ready():        print(f"[Bot] - Logged in as '{bot.user.name}' - '{bot.user.id}'")    @bot.event    async def on_connected():        print(f"[Bot] - Connected!")    @bot.event    async def on_disconnected():        print(f"[Bot] - Disconnected!")    @bot.event    async def on_guild_join(guild):        print(f"[Bot] - Joined new guild: {guild.name} ({guild.member_count})")        server = Server(server=guild.name, members=guild.member_count)        server.save()